export default function MapCard(props) {
    const { name, playlists } = props

    console.log(name.split(" ").join("-"))

    return (
        <div className="MapCard">
            <img alt={name} src={`images/maps/${name.split(" ").join("-")}/{${name.split(" ").join("-")}}.webp`} />
        </div>
    )
}
